import React, {useEffect, useState} from "react";

//Styles


function Description(props) {

    const descriptionValue = props.descriptionValue;

    console.log(descriptionValue);

    return (

        <div className="description-container">
            <h1>Description</h1>

            <p>

                {descriptionValue}

            </p>

        </div>
    );
}

export { Description };
